let data = {
    reviews: [
        {
            userId: 'Tom',
            id: 1,
            title: "Good product",
            body: "I liked this product so much.",
            date: '12/11/2023'
        },
        {
            userId: 'Stephanie',
            id: 2,
            title: "Medium quality product",
            body: "I liked this product but it has some bugs.",
            date: '23/11/2023'
        },
        {
            userId: 'Megan',
            id: 3,
            title: "Don't like it",
            body: "it didn't work.",
            date: '25/09/2023'
        },
    ]
}

export default data;
